import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardActions from '@mui/material/CardActions';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import AuthStyles from '../styles/Auth.module.css';
import FormControl from '@mui/material/FormControl';
import InputLabel from '@mui/material/InputLabel';
import TextField from '@mui/material/TextField';
import FormHelperText from '@mui/material/FormHelperText';



const Login = () => {

    return (
        <div className={AuthStyles['flex-container']}>
            <Card className={AuthStyles['auth-card']}>
                <CardContent>
                    <Typography variant="h6">MooMoo Chat</Typography>
                    <Typography className={AuthStyles['auth-type']}>Login</Typography>
                    <form>
                        <TextField 
                            className={AuthStyles['auth-field']}
                            label='Email'
                            variant='outlined'
                            type='email'
                            color='primary'
                            size='small'
                            placeholder='example@gmail.com'
                            required
                            fullWidth
                        />
                        <TextField 
                            className={AuthStyles['auth-field']}
                            label='Password'
                            variant='outlined'
                            type='password'
                            color='primary'
                            size='small'
                            placeholder='Password'
                            required
                            fullWidth
                        />
                    </form>
                </CardContent>
            </Card>
        </div>
    )
}

export default Login
